import { NavLink, Route, Routes } from 'react-router-dom';
import entering from './Entering.module.css'
import Signup from './Registration/Signup';
import Content from '../Content';

const Entering = () => {
    return(
        <div className={entering.entering}>
            {/* <Routes>
                <Route path='/signup' element={<Signup />} />
            </Routes> */}
            <div className={entering.entering__button}>
                <NavLink to='/login'><span>Log in</span></NavLink>
            </div>
            <div className={entering.entering__button}>
                <NavLink to='/signup'><button onClick={() => {<Signup />}}><span>Sign up</span></button></NavLink>
            </div>
        </div>
    )
}

export default Entering;
